export class Dto {


    public result: number[] = [];
    public previousResult: number[] = [];
    public difference: string[] = [];

    //constructor converts maps into arrays of the values
    constructor(public total: number, result: Map<number, number>, previousResult: Map<number, number>)
        {
            result.forEach((val: number, key: number) => {
                this.result.push(val);
            });
            previousResult.forEach((val: number, key: number) => {
                this.previousResult.push(val);
            });

        }


        public toString(): string {
            console.log("total is : " + this.total);
            console.log("result is : " + this.result);
            console.log("previousResult is : " + this.previousResult);
            console.log("difference is : " + this.difference);
            return "";
        }
}
